    VV.Form.SetFieldValue('Physical Country', VV.Form.GetDropDownListItemValue('Country'), evalGroupsConditions);// Country value drives State dropdown, should be first
    VV.Form.SetFieldValue('Physical Street', VV.Form.GetFieldValue('Street'), evalGroupsConditions);
    VV.Form.SetFieldValue('Physical Street1', VV.Form.GetFieldValue('Street1'), evalGroupsConditions);
    VV.Form.SetFieldValue('Physical Street2', VV.Form.GetFieldValue('Street2'), evalGroupsConditions);
    VV.Form.SetFieldValue('Physical County', VV.Form.GetDropDownListItemValue('County'), evalGroupsConditions);
    VV.Form.SetFieldValue('Physical City', VV.Form.GetFieldValue('City'), evalGroupsConditions);
    VV.Form.SetFieldValue('Physical State', VV.Form.GetDropDownListItemValue('State'), evalGroupsConditions);
    VV.Form.SetFieldValue('Physical Zip Code', VV.Form.GetFieldValue('Zip Code'));
}

