var street = VV.Form.GetFieldValue("Physical Street")
var city = VV.Form.GetFieldValue('Physical City')
var state = VV.Form.GetFieldValue('Physical State')
var zip = VV.Form.GetFieldValue('Physical Zip Code')
var currentCountry = VV.Form.GetFieldValue('Physical Country')
var responseAddressString = VV.Form.GetFieldValue('Address String Field')
var userFormAddressString = street + city + state + zip
userFormAddressString = userFormAddressString.replace(/ /g, '').toUpperCase()
if (responseAddressString != userFormAddressString) {
    if (currentCountry == 'US') {
        if (street && city && state != 'Select Item' && zip) {
            VV.Form.Global.AddressValidation('Physical Country', 'Physical Street', 'Physical Street1', 'Physical City', 'Physical State', 'Physical Zip Code')
        }
    } else if (currentCountry == 'CA') {
        if (street && city && state != 'Select Item' && zip) {
            VV.Form.Global.AddressValidation('Physical Country', 'Physical Street', 'Physical Street1', 'Physical City', 'Physical State', 'Physical Zip Code')
        }
    }
}

// GetRelatedLicenseRecords script on the Individual Record

var GetRelatedLicenseRecords = function () {
    var formData = [];

    var FormInfo = {};
    FormInfo.name = 'Form ID';
    FormInfo.value = VV.Form.GetFieldValue('Form ID');
    formData.push(FormInfo);

    var FormInfo = {};
    FormInfo.name = 'REVISIONID';
    FormInfo.value = VV.Form.DataID;
    formData.push(FormInfo);

    var data = JSON.stringify(formData);
    var requestObject = $.ajax({
        type: "POST",
        url:
            VV.BaseAppUrl +
            "api/v1/" +
            VV.CustomerAlias +
            "/" +
            VV.CustomerDatabaseAlias +
            "/scripts?name=IndividualRecordGetRelatedLicenseRecords",
        contentType: "application/json; charset=utf-8",
        data: data,
        success: "",
        error: "",
    });

    return requestObject;
};

$.when(GetRelatedLicenseRecords())
    .always(function (resp) {
        console.log(resp)

        if (typeof resp.status != "undefined") {
            messageData =
                "A status code of " + resp.status + " returned from the server. There is a communication problem with the  web servers. If this continues, please contact the administrator and communicate to them this message and where it occurred.";
            alert(messageData)
        } else if (typeof resp.statusCode != "undefined") {
            messageData =
                "A status code of " + resp.statusCode + " with a message of '" + resp.errorMessages[0].message + "' returned from the server. This may mean that the servers to run the business logic are not available.";
            alert(messageData)
        }

        else if (resp.meta.status == 200) {
            if (resp.data[0] != 'undefined') {
                if (resp.data[0] == 'Success') {

                    VV.Form.ShowLoadingPanel();

                    // incase postFormRevision slips we double check here:
                    if (resp.data[2] > 0 || resp.data[3] > 0) {
                        VV.Form.SetFieldValue('Has Submitted License', 'Yes')
                    } else {
                        VV.Form.SetFieldValue('Has Submitted License', 'No')
                    }
                    VV.Form.HideLoadingPanel();
                } else if (resp.data[0] == 'Error') {
                    messageData = 'An error was encountered. ' + resp.data[1];
                    alert(messageData);
                } else {
                    messageData = 'An unhandled response occurred when calling the script. The form will not save at this time.  Please try again or communicate this issue to support.';
                    alert(messageData);
                }
            } else {
                messageData = 'The status of the response returned as undefined.';
                alert(messageData);
            }
        }
    })

