VV.Form.ShowLoadingPanel();

$.when(
    CallServerSide()
).always(function (resp) {
    var SaveMsg = "The individual's information has been saved. Creation of a user account in LANCE is dependent upon a valid e-mail address. After verifying the e-mail address against the paper application, navigate to the manage tab and click on the 'Invite User' button. The system will generate and send an e-mail to the individual with the login credentials for their new account. If a user account is not needed, or e-mail address is unknown, clicking “Create Application” from the individual record manage tab will begin the process of creating a new license application for the individual.";
    var SaveHeader = "Record Created";
    console.log(webService);
    VV.Form.HideLoadingPanel();
    var messageData = '';
    if (typeof (resp.status) != 'undefined') {
        messageData = "A status code of " + resp.status + " returned from the server.  There is a communication problem with the  web servers.  If this continues, please contact the administrator and communicate to them this message and where it occurred.";
        VV.Form.Global.DisplayMessaging(messageData);
    }
    else if (typeof (resp.statusCode) != 'undefined') {
        messageData = "A status code of " + resp.statusCode + " with a message of '" + resp.errorMessages[0].message + "' returned from the server.  This may mean that the servers to run the business logic are not available.";
        VV.Form.Global.DisplayMessaging(messageData);
    }
    else if (resp.meta.status == '200') {
        if (resp.data[0] != 'undefined') {
            if (resp.data[0] == 'Success') {
                var hasSubmittedLicense = VV.Form.GetFieldValue('Has Submitted License')
                if (VV.Form.IsFormSaved) {
                    VV.Form.SetFieldValue('FormSaved', true);
                    SaveMsg = "The individual's information has been saved. If the individual has not submitted a license application, any new applications will now update."
                    SaveHeader = "Record Saved"
                    VV.Form.DoAjaxFormSave().then(function () {
                        var grp = VV.Form.GetFieldValue('User Groups');
                        if (grp.indexOf('License Applicant') < 0) {
                            VV.Form.SetFieldValue('Staff Entry', 'True'); //Setting to Staff Entry Status To Perform PostForm Revision In the Event LU Staff created original record, preventing duplicate records. 
                        }
                        if (hasSubmittedLicense != 'Yes') {
                            VV.Form.Template.UpdateLicenseApplication().then(function () {
                                VV.Form.Global.MessageModal(false, SaveHeader, SaveMsg, false, true, 'Ok');
                            })
                        } else {
                            VV.Form.Global.MessageModal(false, SaveHeader, SaveMsg, false, true, 'Ok');
                        }
                    });
                } else {
                    VV.Form.DoAjaxFormSave().then(function (resp) {
                        if (VV.Form.IsFormSaved) {
                            VV.Form.SetFieldValue('FormSaved', true);
                        }
                        var grp = VV.Form.GetFieldValue('User Groups');
                        if (grp.indexOf('License Applicant') < 0) {
                            VV.Form.Global.MessageModal(false, SaveHeader, SaveMsg, false, true, 'Ok', null, null);
                            VV.Form.SetFieldValue('Staff Entry', 'True'); //Setting to Staff Entry Status To Perform PostForm Revision In the Event LU Staff created original record, preventing duplicate records. 
                        }
                    });
                }
            }
            else if (resp.data[0] == 'Error') {
                messageData = 'An error was encountered. ' + resp.data[1];
                VV.Form.HideLoadingPanel();
                VV.Form.Global.MessageModal(false, 'Unable To Process Registration', messageData, false, true, 'Ok', null, null);
            }
            else {
                messageData = 'An unhandled response occurred when calling IndividualRecordCreateUser. The form will not save at this time.  Please try again or communicate this issue to support.';
                VV.Form.HideLoadingPanel();
                VV.Form.Global.MessageModal(false, 'Unable To Process Registration', messageData, false, true, 'Ok');
            }
        }
        else {
            messageData = 'The status of the response returned as undefined.';
            VV.Form.HideLoadingPanel();
            VV.Form.Global.MessageModal(false, 'Unable To Process Registration', messageData, false, true, 'Ok');
        }
    }
    else {
        messageData = "The following unhandled response occurred while attempting to retrieve data on the the server side get data logic." + resp.data.error + '<br>';
        VV.Form.HideLoadingPanel();
        VV.Form.Global.MessageModal(false, 'Unable To Process Registration', messageData, false, true, 'Ok');
    }
});

