// CeaseAndDesistLabelUpdate for Individual Record - Updates the required styling (red asterisk) on certain fields dependent on the value of a checkbox
var CreatedByCeaseAndDesist = VV.Form.GetFieldValue('Created by Cease and Desist').toLowerCase() == 'true';
var MakeLabelRequired = function(labelName, required) {
    var requiredStyle = '<b style="color:red;">*</b>';
    var labelValue = VV.Form.Global.GetLabelValue(labelName).trim();
    var newLabelValue;
    if (required && labelValue.includes(requiredStyle) == false) {
        newLabelValue = labelValue + ' ' + requiredStyle
        VV.Form.Global.SetLabelValue(labelName, newLabelValue);
    } else if (required == false) {
        newLabelValue = labelValue.replace(requiredStyle, '').trim();
        VV.Form.Global.SetLabelValue(labelName, newLabelValue);
    }
}

if (CreatedByCeaseAndDesist) {
    MakeLabelRequired('DateOfBirthLabel', false);
    MakeLabelRequired('USCitizenLabel', false);
    MakeLabelRequired('HasSSNLabel', false);
    MakeLabelRequired('SSNLabel', false);
} else {
    MakeLabelRequired('DateOfBirthLabel', true);
    MakeLabelRequired('USCitizenLabel', true);
    MakeLabelRequired('HasSSNLabel', true);
    MakeLabelRequired('SSNLabel', true);
}

