                    VV.Form.Global.MessageModal(false, 'Existing User Record Match Found', 'An existing User record has been found matching the information you have entered. An account has been created for that User Registration record and login credentials have been sent by email.', false, true, 'Ok', closeWindow);
                    VV.Form.SetFieldValue('Status', 'Staff Created')
                    VV.Form.DoAjaxFormSave();
