                    VV.Form.Global.MessageModal(false, 'Duplicate Existing User Record', 'A duplicate Existing User Registration record was found, but did not contain an email. The State Staff has been notified.', false, true, 'Ok', closeWindow);
                } else {
                    VV.Form.DoAjaxFormSave().then(function () {
                        VV.Form.Template.CreateUserAndSubmit();
                    });
                }
            } else if (resp.data[0] == 'Error') {
                messageData = 'An error was encountered. ' + resp.data[1];
                VV.Form.HideLoadingPanel();
                //VV.Form.Global.DisplayMessaging(messageData);
                VV.Form.Global.MessageModal(false, 'Unable To Process Registration', messageData, false, true, 'Ok');
            } else {
                messageData = 'An unhandled response occurred when calling IndividualRecordCreateUser. The form will not save at this time.  Please try again or communicate this issue to support.';
