    var formData = VV.Form.getFormDataCollection();

    // var FormInfo = {};
    // FormInfo.name = 'REVISIONID';
    // FormInfo.value = VV.Form.DataID;
    // formData.push(FormInfo);

    // var FormInfo = {};
    // FormInfo.name = 'USERID';
    // FormInfo.value = VV.Form.FormUsID;
    // formData.push(FormInfo);

    var URLInfo = {};
    URLInfo.name = 'baseURL';
    URLInfo.value = VV.BaseAppUrl;
    formData.push(URLInfo);

    //Following will prepare the collection and send with call to server side script.
    var data = JSON.stringify(formData);
    var requestObject = $.ajax({
        type: "POST",
        url: VV.BaseAppUrl + 'api/v1/' + VV.CustomerAlias + '/' + VV.CustomerDatabaseAlias + '/scripts?name=IndividualRecordCreateUser',
        contentType: "application/json; charset=utf-8",
        data: data,
        success: '',
        error: ''
    });

    return requestObject;
};

VV.Form.ShowLoadingPanel();

$.when(
    CallServerSide()
).always(function (resp) {

    VV.Form.HideLoadingPanel();
    var messageData = '';
    if (typeof (resp.status) != 'undefined') {
        messageData = "A status code of " + resp.status + " returned from the server.  There is a communication problem with the  web servers.  If this continues, please contact the administrator and communicate to them this message and where it occurred.";
        VV.Form.Global.DisplayMessaging(messageData);
    }
    else if (typeof (resp.statusCode) != 'undefined') {
        messageData = "A status code of " + resp.statusCode + " with a message of '" + resp.errorMessages[0].message + "' returned from the server.  This may mean that the servers to run the business logic are not available.";
        VV.Form.Global.DisplayMessaging(messageData);
    }
    else if (resp.meta.status == '200') {
        if (resp.data[0] != 'undefined') {
            if (resp.data[0] == 'Success') {
                if (resp.data[1] == 'User Created') {
                    VV.Form.SetFieldValue('FormSaved', 'True');
                    VV.Form.SetFieldValue('Status', 'Active');
                    VV.Form.SetFieldValue('Email Sent', 'True');
                    VV.Form.DoAjaxFormSave()
                    //Determine if Form Has Been previously Saved.
                    //VV.Form.SetFieldValue('Account Created Check', 'True');
                    VV.Form.Global.MessageModal(false, resp.data[1], 'The user account has been created, and the user has been notified of their login information via email. The record has been saved.', false, true, 'Ok', redirectToSubmitted);
                }
                else if (resp.data[1] == 'User Exists') {
                    VV.Form.SetFieldValue('FormSaved', 'True');
                    VV.Form.SetFieldValue('Status', 'Active');
                    VV.Form.DoAjaxFormSave()
                    //VV.Form.SetFieldValue('Account Created Check', 'True');
                    VV.Form.Global.MessageModal(false, resp.data[1], 'The user account already exists. The record has been updated to reflect the existing record and saved.', false, true, 'Ok', redirectToSubmitted);
                }
                else if (resp.data[1] == 'User Disabled') {
                    VV.Form.SetFieldValue('FormSaved', 'True');
                    VV.Form.SetFieldValue('Status', 'Inactive');
                    //VV.Form.SetFieldValue('Account Created Check', 'True');
                    //VV.Form.SetFieldValue('Account Disabled Check', 'True');
                    VV.Form.Global.MessageModal(false, resp.data[1], 'The user account exists, but it is not enabled. The user will not be able to log in until the Enable User button is used to enable their user account. The record has been saved.', false, true, 'Ok', redirectToSubmitted);
                }
                VV.Form.HideLoadingPanel();
            }
            else if (resp.data[0] == 'Minor Error') {
                VV.Form.SetFieldValue('Status', 'Active');
                //VV.Form.SetFieldValue('Account Created Check', 'True');
                VV.Form.ShowLoadingPanel();
                VV.Form.DoAjaxFormSave().then(function (resp) {
                    VV.Form.HideLoadingPanel();
                    //VV.Form.Global.DisplayMessaging(messagedata);
                    VV.Form.Global.MessageModal(false, resp.data[0], 'The user account has been created, but not all steps in the process may have been completed successfully. The following errors were encountered. ' + resp.data[1] + ' The record has been saved.', false, true, 'Ok');
                });
            }
            else if (resp.data[0] == 'Error') {
                VV.Form.HideLoadingPanel();
                //VV.Form.Global.DisplayMessaging(messageData);
                VV.Form.Global.MessageModal(false, resp.data[0], 'An error was encountered. ' + resp.data[1], false, true, 'Ok');
            }
            else {
                VV.Form.HideLoadingPanel();

                VV.Form.Global.MessageModal(false, 'Error', 'An unhandled response occurred when calling IndividualRecordCreateUser. The form will not save at this time.  Please try again or communicate this issue to support.', false, true, 'Ok');
            }
        }
        else {
            VV.Form.HideLoadingPanel();
            //VV.Form.Global.DisplayMessaging(messageData);
            VV.Form.Global.MessageModal(false, 'Error', 'The status of the response returned as undefined.', false, true, 'Ok');
        }
    }
    else {
        VV.Form.HideLoadingPanel();
        //VV.Form.Global.DisplayMessaging(messageData);
        VV.Form.Global.MessageModal(false, 'Error', "The following unhandled response occurred while attempting to retrieve data on the the server side get data logic." + resp.data.error + '<br>', false, true, 'Ok');
    }
}, function (err) {
    //there is an exception in the request
    console.log(err)
});
