    let data = JSON.stringify(formData);
    let requestObject = $.ajax({
        type: "POST",
        url: VV.BaseAppUrl + 'api/v1/' + VV.CustomerAlias + '/' + VV.CustomerDatabaseAlias + '/scripts?name=IndividualRecordApplyDeathToLicenses',
        contentType: "application/json; charset=utf-8",
        data: data,
        success: '',
        error: ''
    });

    return requestObject;
};

$.when(
    ApplyDeathToLicenses()
).always(function (resp) {
    VV.Form.HideLoadingPanel();
    let messageData = '';
    console.log(resp)
    if (typeof (resp.status) != 'undefined') {
        messageData = "A status code of " + resp.status + " returned from the server.  There is a communication problem with the  web servers.  If this continues, please contact the administrator and communicate to them this message and where it occured.";
        alert(messageData);
    }
    else if (typeof (resp.statusCode) != 'undefined') {
        messageData = "A status code of " + resp.statusCode + " with a message of '" + resp.errorMessages[0].message + "' returned from the server.  This may mean that the servers to run the business logic are not available.";
        alert(messageData);
    }
    else if (resp.meta.status == '200') {
        if (resp.data[0] != 'undefined') {
            if (resp.data[0] == 'Success') {
                if (resp.data[2]) {
                    let message = resp.data[2]
                    VV.Form.Global.MessageModal(false, 'No Records Found', message, false, true, 'Ok');
                } else {
                    VV.Form.Global.MessageModal(false, 'Records Updated', 'License Details records have been updated.', false, true, 'Ok');
                }

                VV.Form.DoAjaxFormSave();
            }
            else if (resp.data[0] == 'Error') {
                messageData = 'An error was encountered. ' + resp.data[1];
                VV.Form.HideLoadingPanel();
                alert(messageData);
            }
            else {
                messageData = 'An unhandled response occurred.  The form will not save at this time.  Please try again or communicate this issue to support.';
                VV.Form.HideLoadingPanel();
                alert(messageData);
            }
        }
        else {
            messageData = 'The status of the response returned as undefined.';
            VV.Form.HideLoadingPanel();
            alert(messageData);
        }
    }
    else {
        messageData = 'The following error(s) were encountered: ' + resp.data.error + '<br>';
        VV.Form.HideLoadingPanel();
        alert(messageData);
    }
});

